# Parse ADC Capture data to find the RMS value
import numpy as np
import matplotlib.pyplot as plt

voltage = []

def data_median(data):  # Return the data list and median from paste
    for line in data.splitlines():
        if '\t' in line and '.' in line and not 'NaN' in line:
            voltage.append(float(line[line.index('\t')+1:]))
    return voltage, np.median(voltage)

def envelope(signal):
    Fsignal = np.fft.fft(signal)  # FFT(signal)
    # Get each frequency contained in the signal
    frequencies = np.fft.fftfreq(len(signal))  # Get frequencies of the FFT
    # At each index where the frequency is negative, set the magnitude to zero
    Fsignal[np.where(frequencies < 0)] = 0.  # *Heaviside
    return np.abs(np.fft.ifft(Fsignal*2))  # magnitude of inverse FFT of *2

def amplitude(data): # Return the noise level
    voltage, _ = data_median(data)
    # Return the Square Root of the Mean of the Squares
    dc = np.mean(voltage) # Find the DC of the signal to remove later
    env = envelope(voltage) # Find the envelope of the signal
    env_no_dc = [e - dc for e in env] # Remove the DC from the envelope
    return 20*np.log10(np.mean(env_no_dc)) # Add the avg envelope to amplitudes

